	(405, 'edd_sl_3b37c9ae34f8ba623775dd0a9f2dfaba', 'a:2:{s:7:"timeout";i:1610940243;s:5:"value";s:22924:"{"new_version":"3.1.6","stable_version":"3.1.6","name":"WordPress Advanced Database Cleaner","slug":"advanced-db-cleaner","url":"https:\\/\\/sigmaplugin.com\\/downloads\\/wordpress-advanced-database-cleaner\\/?changelog=1","last_updated":"2020-10-06 01:05:56","homepage":"https:\\/\\/sigmaplugin.com\\/downloads\\/wordpress-advanced-database-cleaner\\/","sections":{"description":"<p>Do you know that even after deleting a plugin\\/theme from your WordPress website, some of its leftovers may remain in your database? Such as orphan options, orphan tables and orphan cron tasks. As you may know, not all plugins\\/themes care about the housekeeping of your WordPress database. As long as you are removing plugins\\/themes, leftovers will be accumulated in your database and will influence your website performance. The Pro version of Advanced Database Cleaner will help you remove all those leftovers and perform a deep database clean up. In the pro version you can:<\\/p>\\n<p>* Classify options according to their \\"creator\\". They can be either: plugins options, themes options or WP core options<br \\/>\\n* Detect and delete orphan options.<br \\/>\\n* Classify tables according to their \\"creator\\". They can be either: plugins tables, themes tables or WP core tables<br \\/>\\n* Detect and delete orphan tables.<br \\/>\\n* Classify all cron tasks according to their \\"creator\\". They can be either: plugins cron tasks, themes cron tasks or WP core tasks<br \\/>\\n* Detect and delete orphan cron tasks.<br \\/>\\n* Search & filter options, tables and cron tasks based on several criteria such as the \\"name\\", \\"creator\\", \\"value\\", etc.<br \\/>\\n* Get premium support: we will provide a quick support as well as any technical answers to help you cleanup your database efficiently<\\/p>\\n","changelog":"<p><strong>= 3.1.6 - 06\\/10\\/2020 =<\\/strong><br \\/>\\n- Tweak: Cleaning the code by deleting unused blocks of code<br \\/>\\n- Tweak: Enhancing the security of the plugin<\\/p>\\n<p><strong>= 3.1.5 - 04\\/09\\/2020 =<\\/strong><br \\/>\\n- Fix: an issue of timeout that occurs when scanning items is now fixed<br \\/>\\n- Fix: some calls in JS file has been corrected<br \\/>\\n- Fix: fixing an issue in the general cleanup tab preventing users from deleting orphaned items on WP 5.5<br \\/>\\n- Fix: the warning \\"Deprecated: array_key_exists()\\" is now solved<br \\/>\\n- Tweak: deleting two scan files generated by the plugin to enhance security<br \\/>\\n- Tweak: we are now using SweetAlert for all popup boxes<br \\/>\\n- Tweak: enhancing the JavaScript code<br \\/>\\n- Tweak: enhancing some blocks of code<br \\/>\\n- Tweak: enhancing the security of the plugin<br \\/>\\n- New: you can now scan individual items besides scanning all items<br \\/>\\n- New: you can now edit the categorization of items and correct it manually if needed<br \\/>\\n- New great features are coming very soon!<br \\/>\\n- Tested with WordPress 5.5<br \\/>\\n- (Note: When upgrading to this new version, please make sure to clear your browser cache)<\\/p>\\n<p><strong>= 3.1.0 - 04\\/12\\/2019 =<\\/strong><br \\/>\\n- Fix: In some previous versions, tables were not shown for some users. This has been fixed<br \\/>\\n- Fix: The plugin is not ready to optimize InnoDB tables, this feature has been deleted temporarily<br \\/>\\n- SECURITY (PRO): Add security level to the folder containing scan results<br \\/>\\n- SECURITY (PRO): Hide the license key after deactivating it<\\/p>\\n<p>=<strong> 3.0.0 - 04\\/11\\/2019 =<\\/strong><br \\/>\\n* IMPORTANT NOTICE FOR PRO USERS: After you upgrade to 3.0.0 from an old version, you will notice that WordPress has deactivated the plugin due to an error: \'Plugin file does not exist\'. This is because we have renamed the pro plugin folder name from \\"advanced-db-cleaner\\" to \\"advanced-database-cleaner-pro\\", causing the WordPress to not being able to find the old one and therefore deactivating the plugin. Just activate it again. It doesn\\u2019t break anything. Once you activate the plugin again it will continue working normally without any issues. You will also probably lose the pro version after this upgrade (This is due to a conflict between the free and pro versions which is now solved). If it is the case, please follow these steps to restore your pro version with all new features: (https:\\/\\/sigmaplugin.com\\/blog\\/restore-pro-version-after-upgrade-to-3-0-0)<\\/p>\\n<p>* COMPATIBILITY: The plugin is tested with WordPress 5.3<br \\/>\\n* CHANGE: Some changes to readme.txt file<br \\/>\\n* REMOVE: Drafts are not cleaned anymore in 3.0.0 since many users have reported that drafts are useful for them<br \\/>\\n* New: You can now clean up new items: pingbacks, trackbacks, orphaned user meta, orphaned term meta, expired transients<br \\/>\\n* New: The plugin icon in the left side menu has been changed to white color<br \\/>\\n* New: Change text-domain to \'advanced-database-cleaner\'<br \\/>\\n* New: Enhancements to the look and feel of the plugin<br \\/>\\n* New: The sidebar has been changed for the free version and deleted in the pro version<br \\/>\\n* New: For options, we have added the option size column and two new actions: Set autoload to no \\/ yes<br \\/>\\n* New: For tables, we have added two actions: Empty tables and repair tables<br \\/>\\n* New: InnoDB tables can be optimized now as well<br \\/>\\n* New: You can now order and sort all items<br \\/>\\n* New: You can change the number of items per page<br \\/>\\n* New: You can keep last x days\' data from being cleaned and clean only data older than the number of days you have specified<br \\/>\\n* New: You can specify elements to cleanup in a scheduled task. You can also create as many scheduled tasks as you need<br \\/>\\n* New: Add information to each line of unused data in \'General clean-up\' tab to let users know more about each item they will clean<br \\/>\\n* New: Display\\/view items before cleaning them (in \'General cleanup\' tab) is now in the free version<br \\/>\\n* New: Add a new setting to hide the \\"premium\\" tab in the free version<br \\/>\\n* Fix: Repair some strings with correct text domain<br \\/>\\n* Fix: Some tasks with arguments can\'t be cleaned. This is fixed now<br \\/>\\n* Fix: Some tasks with the same hook name and different arguments were not displayed. This is fixed now<br \\/>\\n* PERFORMANCE: All images used by the plugin are now in SVG format<br \\/>\\n* PERFORMANCE: Restructuring the whole code for better performance<br \\/>\\n* SECURITY: add some _wpnonce to forms<br \\/>\\n* New (PRO): Add \\"Pro\\" to the title of the pro version to distinguish between the free and the pro versions<br \\/>\\n* New (PRO): You can now search and filter all elements: options, tables, tasks, etc. based on several criteria<br \\/>\\n* New (PRO): Add progress bar when searching for orphan items to show remaining items to process<br \\/>\\n* New (PRO): Add a category called \\"uncategorized\\" to let users see items that have not been categorized yet<br \\/>\\n* Fix (PRO): The activation issue is now fixed<br \\/>\\n* Fix (PRO): The scan of orphaned items generated timeout errors for big databases, we use now ajax to solve this<br \\/>\\n* Fix (PRO): A conflict between the free and the pro versions is now solved<br \\/>\\n* PERFORMANCE (PRO): We are now using an enhanced new update class provided by EDD plugin<br \\/>\\n* PERFORMANCE (PRO): Set autoload to no in all options used by the plugin<br \\/>\\n* PERFORMANCE (PRO): The plugin does not store scan results in DB anymore. We use files instead<br \\/>\\n* SECURITY (PRO): The license is now hidden after activation for security reasons<br \\/>\\n* WEBSITE (PRO): You can now view your purchase history, downloads, generate an invoice, upgrade your license, etc. [Read more](https:\\/\\/sigmaplugin.com\\/blog\\/how-to-get-access-to-my-account-and-downloads)<br \\/>\\n* WEBSITE (PRO): Enhancements of the [plugin premium page](https:\\/\\/sigmaplugin.com\\/downloads\\/wordpress-advanced-database-cleaner)<\\/p>\\n<p><strong>= 2.0.0 =<\\/strong><br \\/>\\n* Some changes to readme.txt file<br \\/>\\n* Changing the way the plugin can be translated<br \\/>\\n* Correcting __() to some texts<br \\/>\\n* Correcting some displaying texts<br \\/>\\n* Big change in styles<br \\/>\\n* Restructuring the whole code for better performance<br \\/>\\n* Creation of the plugin main page: (https:\\/\\/sigmaplugin.com\\/downloads\\/wordpress-advanced-database-cleaner)<br \\/>\\n* Adding language translation support<br \\/>\\n* Correct the time zone offset for the scheduled tasks<br \\/>\\n* Skipping InnoDB tables while optimizing<br \\/>\\n* Change size of lost tables data from \'o\' to \'KB\'<br \\/>\\n* Main menu is now under \'Tools\' not \'settings\'<br \\/>\\n* Adding separate left menu (can be disabled)<br \\/>\\n* Adding overview page with some useful information<br \\/>\\n* Adding settings page<br \\/>\\n* \\"Reset database\\" is now in a separate plugin (please view our plugins page)<br \\/>\\n* Multisite: now only the main site can clean the network<br \\/>\\n* New feature: Display\\/view items before cleaning them (Pro)<br \\/>\\n* New feature: view and clean options<br \\/>\\n* New feature: Detect orphan options, plugins options, themes options and WP options (Pro)<br \\/>\\n* New feature: view and clean cron (scheduled tasks)<br \\/>\\n* New feature: Detect orphan tasks, plugins tasks, themes tasks and WP tasks (Pro)<br \\/>\\n* New feature: view and clean database tables<br \\/>\\n* New feature: Detect orphan tables, plugins tables, themes tables and WP tables (Pro)<\\/p>\\n<p><strong>= 1.3.7 =<\\/strong><br \\/>\\n* Adding \\"clean trash-posts\\"<br \\/>\\n* Updating FAQ<br \\/>\\n* Updating readme file<br \\/>\\n* Tested up to: 4.4<\\/p>\\n<p><strong>= 1.3.6 =<\\/strong><br \\/>\\n* Fixing a problem in donate button<br \\/>\\n* Using _e() and __() for all texts in the plugin<\\/p>\\n<p><strong>= 1.3.5 =<\\/strong><br \\/>\\n* New feature: Adding \\"Clean Cron\\". You can now clean unnecessary scheduled tasks.<br \\/>\\n* Updating FAQ<\\/p>\\n<p><strong>= 1.3.1 =<\\/strong><br \\/>\\n* Adding FAQ<\\/p>\\n<p><strong>= 1.3.0 =<\\/strong><br \\/>\\n* Some code optimizations<br \\/>\\n* New feature: Support multisite. You can now clean and optimize your database in multisite installation.<\\/p>\\n<p><strong>= 1.2.3 =<\\/strong><br \\/>\\n* Some optimizations and style modifications<br \\/>\\n* New feature: Adding the scheduler. You can now schedule the clean-up and optimization of your database.<\\/p>\\n<p><strong>= 1.2.2 =<\\/strong><br \\/>\\n* Some optimizations and style modifications<\\/p>\\n<p><strong>= 1.2.1 =<\\/strong><br \\/>\\n* Some optimizations and style modifications<br \\/>\\n* \\"Clean database\\" tab shows now only elements that should be cleaned instead of listing all elements.<br \\/>\\n* \\"Clean database\\" tab shows now an icon that indicates the state of your database.<br \\/>\\n* \\"Optimize database\\" tab shows now only tables that should be optimized instead of listing all tables.<br \\/>\\n* \\"Optimize database\\" tab shows now an icon that indicates the state of your tables.<br \\/>\\n* \\"Reset database\\" shows now a warning before resetting the database.<\\/p>\\n<p><strong>= 1.2.0 =<\\/strong><br \\/>\\n* Some optimizations and style modifications<br \\/>\\n* New feature: Adding \\"Reset database\\"<\\/p>\\n<p><strong>= 1.1.1 =<\\/strong><br \\/>\\n* Some optimizations and style modifications<br \\/>\\n* Adding \\"Donate link\\"<\\/p>\\n<p><strong>= 1.1.0 =<\\/strong><br \\/>\\n* Some optimizations and style modifications<br \\/>\\n* New feature: Adding \\"Optimize Database\\"<\\/p>\\n<p><strong>= 1.0.0 =<\\/strong><br \\/>\\n* First release: Hello world!<\\/p>\\n"},"banners":{"high":"","low":""},"icons":{"1x":"https:\\/